export class TosKlingonUniformPack extends BaseKlingonUniformPack implements IUniformPack {

    getUniformSwatches() {
        return [
            new Swatch(BodyType.AverageMale, "Average Male", (token) => UniformCatalog.decorateSwatch(OriginalSeriesKlingon.averageMaleNeck + OriginalSeriesKlingon.averageMaleBody, BodyType.AverageMale, token), "BodyType.averageMale"),
            new Swatch(BodyType.AverageFemale, "Average Female", (token) => UniformCatalog.decorateSwatch(OriginalSeriesKlingon.averageFemaleNeck + OriginalSeriesKlingon.averageFemaleBody, BodyType.AverageFemale, token), "BodyType.averageFemale"),
            ];
    }

    getUniformAndVariantBody(token: Token) {
        let result = "";
        let neck = "";
        switch (token.bodyType) {
            case BodyType.AverageMale:
                neck = OriginalSeriesKlingon.averageMaleNeck;
                result = OriginalSeriesKlingon.averageMaleBody;
                if (token.variant === UniformVariantType.Variant1) {
                    result += sash;
                }
                break;
            case BodyType.AverageFemale:
            default:
                neck = OriginalSeriesKlingon.averageFemaleNeck;
                result = OriginalSeriesKlingon.averageFemaleBody;
        }

        if (token.species === Species.Bolian) {
            switch (token.bodyType) {
                case BodyType.AverageMale:
                    neck += BaseMaleBodyBolianNeckRidge;
                    break;
                case BodyType.AverageFemale:
                    neck += BaseFemaleBolianNeckRidge;
                    break;
                default:
            }
        }
        return (neck + result).replace(DefaultRed, token.divisionColor).replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
    }

    getUniformVariantSwatches(token: Token) {
        if (token.bodyType === BodyType.AverageMale && token.rankIndicator === Rank.Captain) {
            return [
                new Swatch(UniformVariantType.Base, "Base", (token) => UniformCatalog.decorateSwatch(OriginalSeriesKlingon.averageMaleNeck + OriginalSeriesKlingon.averageMaleBody, 100000 + UniformVariantType.Base, token)),
                new Swatch(UniformVariantType.Variant1, "With Sash", (token) => UniformCatalog.decorateSwatch(OriginalSeriesKlingon.averageMaleNeck + OriginalSeriesKlingon.averageMaleBody + sash, 100000 + UniformVariantType.Variant1, token)),

            ]
        } else {
            return [];
        }
    }

    getRankIndicator(token: Token) {
        let borderRank = this.getRankBorderIndicator(token);
        if (token.bodyType === BodyType.AverageMale) {
            if (token.variant === UniformVariantType.Variant1) {
                return `<g transform="matrix(0.18836329,0,0,0.18836329,146.95423,199.86901)">`
                        + borderRank +
                `</g>`;
            } else {
                return `<g transform="matrix(0.18836329,0,0,0.18836329,146.95423,199.86901)">`
                        + borderRank +
                    `</g><g transform="matrix(0.15346879,0,0,0.16820895,289.72087,206.74823)">`
                        + borderRank +
                `</g>`;
            }
        } else {
            return `<g transform="matrix(0.18836329,0,0,0.18836329,128.32409,255.21148)">`
                    + borderRank +
                `</g><g transform="matrix(0.15346879,0,0,0.16820895,322.04964,246.74823)">`
                    + borderRank +
            `</g>`;
        }
    }
}